package com.robonobo.mina.external;

public class Application {
	String homeUri;
	String updateUri;
	String descriptorUri;
	String name;
	String publisher;
	String version;
	String description;
	
	public String getUpdateUri() {
		return updateUri;
	}
	public void setUpdateUri(String updateUri) {
		this.updateUri = updateUri;
	}
	public String getDescriptorUri() {
		return descriptorUri;
	}
	public void setDescriptorUri(String descriptorUri) {
		this.descriptorUri = descriptorUri;
	}
	public String getHomeUri() {
		return homeUri;
	}
	public void setHomeUri(String homeUri) {
		this.homeUri = homeUri;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getPublisher() {
		return publisher;
	}
	public void setPublisher(String publisher) {
		this.publisher = publisher;
	}
	public String getVersion() {
		return version;
	}
	public void setVersion(String version) {
		this.version = version;
	}
	public String getDescription() {
		return description;
	}
	public void setDescription(String description) {
		this.description = description;
	}

	
}